import React from 'react';
import { Card, CardContent, Typography, Grid } from '@material-ui/core';
import image1 from '../images/image1.jpg';
import image2 from '../images/image2.png';
import image3 from '../images/image3.webp';
import image4 from '../images/image4.webp';
import image5 from '../images/image5.jpg';
import Cards from "./Cards/Cards";

function Home() {
  return (
    <div>
      <header className="py-5 bg-light border-bottom mb-4">
        <div className="container">
          <div className="text-center my-5">
            <h1 className="fw-bolder">Welcome to Home!</h1>
            <p className="lead mb-0">Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet</p>
          </div>
        </div>
      </header>
      <div className="container">
        <Grid container spacing={4}>
          {[
            { image: image1, date: 'January 1, 2022', title: 'Featured Post Title', text: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Reiciendis aliquid atque, nulla? Quos cum ex quis soluta, a laboriosam. Dicta expedita corporis animi vero voluptate voluptatibus possimus, veniam magni quis!' },
            { image: image2, date: 'February 1, 2022', title: 'Post Title', text: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Reiciendis aliquid atque, nulla.' },
            { image: image3, date: 'March 1, 2022', title: 'Post Title', text: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Reiciendis aliquid atque, nulla.' },
            { image: image4, date: 'April 1, 2022', title: 'Post Title', text: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Reiciendis aliquid atque, nulla.' },
            { image: image5, date: 'May 1, 2022', title: 'Post Title', text: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Reiciendis aliquid atque, nulla?' }
          ].map((item, index) => (
            <Grid item key={index} xs={12} sm={6}>
              <Card>
                <a href="#!"><img className="card-img-top" src={item.image} alt="..." /></a>
                <CardContent>
                  <Typography variant="subtitle2" color="textSecondary" gutterBottom>{item.date}</Typography>
                  <Typography variant="h5" component="h2">{item.title}</Typography>
                  <Typography variant="body2" component="p">{item.text}</Typography>
                  <a className="btn btn-primary" href="#!">Read more â†’</a>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </div>
      <Cards id="Home" />
    </div>
  );
}

export default Home;
